import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className="bg-gray-900 text-white min-h-screen flex flex-col">
            <header className="flex justify-between items-center p-6">
                <h1 className="text-3xl font-bold">Doberman Breeding Business</h1>
                <nav>
                    <Link to="/about" className="mx-4 hover:text-gray-400">About Us</Link>
                    <Link to="/available-puppies" className="mx-4 hover:text-gray-400">Available Puppies</Link>
                    <Link to="/gallery" className="mx-4 hover:text-gray-400">Gallery</Link>
                    <Link to="/testimonials" className="mx-4 hover:text-gray-400">Testimonials</Link>
                    <Link to="/blog" className="mx-4 hover:text-gray-400">Blog</Link>
                    <Link to="/contact" className="mx-4 hover:text-gray-400">Contact</Link>
                </nav>
            </header>
            <main className="flex-grow flex flex-col items-center justify-center">
                <section className="text-center">
                    <h2 className="text-5xl font-bold mb-4">Welcome to Our Doberman Family</h2>
                    <p className="mb-6">We are dedicated to breeding healthy, happy Dobermans with excellent temperaments.</p>
                    <Link to="/available-puppies" className="bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-500 transition">View Available Puppies</Link>
                </section>
            </main>
            <footer className="bg-gray-800 p-4 text-center">
                <p>&copy; {new Date().getFullYear()} Doberman Breeding Business. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default Home;
